    false,nt"url": null,nt"notes": "This narrative report for Okefenokee National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1947.
    The report begins by summarizing the weather conditions, water conditions, wildfires,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, raptors, fish, and reptiles- is also covered.
    The physical development and maintenance section discusses physical developments.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, fishing, and violations. Items of interest and N-R forms are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
